    <div class="con-1-text">
      <h1 class="title">
        나만의 패션 취향만큼<br>
        나만이 가장 잘 알수 있으니까
      </h1>
      <h2 class="sub-title">
        다양한 패션 취향만큼,쇼핑의 니즈도 제각각이죠.<br>
        모두의 쇼핑 니즈를 채워 줄 다섯 가지 쇼핑 공간을 헌데 모았습니다.<br>
        백화점, 아울렛, 브랜드 직영몰, 소호&스트릿, 디자이너관까지
      </h2>
      <h2 class="sub-title">
        내 취향과 니즈는 단순하지 않지만 패션은 패션타운 하나로 끝.
      </h2>
